import { Inputs } from "../pages/authorization/Inputs_auth";
import { SwitchCheckBox } from "../pages/authorization/SwitchCheckBox";

export const FormikControl = (props) => {
  switch (props.control) {
    case "input":
      return <Inputs {...props} />;
    case "select":
      return {};
    case "textArea":
      return <TextArea {...props}/>;
    case "addFile":
      return {};
    case "checkbox":
      return <SwitchCheckBox />;
  }
};
